(128, 6, 18, 're2:neatza', '[message] nu e bug ... e de la ei cand au creat artefactele au copiat planu de ww si l-au modificat sa nu poti face ww cu el dar sa poti construi he si ge tre sa dezactivezi minunea lumi lvl 0\r\n\r\n_________________________\r\nReply:\r\n\r\n Noroc . Da ai dreptate , trebuie WW level 0 , am adaugat pe lista de bug-uri\r\n\r\n\r\n_________________________\r\nReply:\r\n\r\n[/message]', 1, 0, 0, 1373263090, 0, 0, 0, 0, 0, 0),
(129, 18, 6, 're3:neatza', '[message] E dezactivata minunea lumii , daca te uiti in statistici la WW nu apar satele natare pentru WW si nici planurile de constructii , ceea ce se intampla este bug , greseala in codul de programare , o sa ma uit , practic sistemul gandeste in felul urmator \r\n\r\nDaca ai WW level 0 si hambar granar level 20 + primarie level 20 te lasa sa faci granar si hambar exitins in satul WW\r\n\r\nDaca ai artefactul respectiv (masterplan) si primarie level 20 plus hambar si granar level 20 te lasa sa faci granar extins si hambar extins (doar ca aici cere si WW level 0) ceea ce nu ar trebui sa faca.\r\n\r\n_________________________\r\nReply:\r\n\r\n nu e bug ... e de la ei cand au creat artefactele au copiat planu de ww si l-au modificat sa nu poti face ww cu el dar sa poti construi he si ge tre sa dezactivezi minunea lumi lvl 0\r\n\r\n_________________________\r\nReply:\r\n\r\n Noroc . Da ai dreptate , trebuie WW level 0 , am adaugat pe lista de bug-uri\r\n\r\n\r\n_________________________\r\nReply:\r\n\r\n[/message]', 1, 0, 0, 1373263383, 0, 0, 0, 0, 0, 0),
(130, 6, 18, 'daca vrei ', '[message]si ai timp imi , si nu dureaza foarte mult sa le faci .... poti sa imi faci si pe roman cateva he si ge asta daca nu cer prea mult ..... daca nu lasale ca le-om face cand  gasesti buba la plan[/message]', 1, 0, 0, 1373263446, 0, 0, 0, 0, 0, 0),
(131, 6, 18, 're4:neatza', '[message] cere pentru ca s-a mai intamplat pe un server si l-au rezolvat de aparea \r\n\r\nprimarie lvl 10  , minunea lumi lvl 0\r\n                           ---------------------\r\n     \r\n\r\ndar era taiatcu o linie\r\n\r\n_________________________\r\nReply:\r\n\r\n E dezactivata minunea lumii , daca te uiti in statistici la WW nu apar satele natare pentru WW si nici planurile de constructii , ceea ce se intampla este bug , greseala in codul de programare , o sa ma uit , practic sistemul gandeste in felul urmator \r\n\r\nDaca ai WW level 0 si hambar granar level 20 + primarie level 20 te lasa sa faci granar si hambar exitins in satul WW\r\n\r\nDaca ai artefactul respectiv (masterplan) si primarie level 20 plus hambar si granar level 20 te lasa sa faci granar extins si hambar extins (doar ca aici cere si WW level 0) ceea ce nu ar trebui sa faca.\r\n\r\n_________________________\r\nReply:\r\n\r\n nu e bug ... e de la ei cand au creat artefactele au copiat planu de ww si l-au modificat sa nu poti face ww cu el dar sa poti construi he si ge tre sa dezactivezi minunea lumi lvl 0\r\n\r\n_________________________\r\nReply:\r\n\r\n Noroc . Da ai dreptate , trebuie WW level 0 , am adaugat pe lista de bug-uri\r\n\r\n\r\n_________________________\r\nReply:\r\n\r\n[/message]', 1, 0, 0, 1373263577, 0, 0, 0, 0, 0, 0),
(132, 18, 6, 're5:neatza', '[message] Nu stiu unde plm sa caut acum :))\r\n\r\n_________________________\r\nReply:\r\n\r\n cere pentru ca s-a mai intamplat pe un server si l-au rezolvat de aparea \r\n\r\nprimarie lvl 10  , minunea lumi lvl 0\r\n                           ---------------------\r\n     \r\n\r\ndar era taiatcu o linie\r\n\r\n_________________________\r\nReply:\r\n\r\n E dezactivata minunea lumii , daca te uiti in statistici la WW nu apar satele natare pentru WW si nici planurile de constructii , ceea ce se intampla este bug , greseala in codul de programare , o sa ma uit , practic sistemul gandeste in felul urmator \r\n\r\nDaca ai WW level 0 si hambar granar level 20 + primarie level 20 te lasa sa faci granar si hambar exitins in satul WW\r\n\r\nDaca ai artefactul respectiv (masterplan) si primarie level 20 plus hambar si granar level 20 te lasa sa faci granar extins si hambar extins (doar ca aici cere si WW level 0) ceea ce nu ar trebui sa faca.\r\n\r\n_________________________\r\nReply:\r\n\r\n nu e bug ... e de la ei cand au creat artefactele au copiat planu de ww si l-au modificat sa nu poti face ww cu el dar sa poti construi he si ge tre sa dezactivezi minunea lumi lvl 0\r\n\r\n_________________________\r\nReply:\r\n\r\n Noroc . Da ai dreptate , trebuie WW level 0 , am adaugat pe lista de bug-uri\r\n\r\n\r\n_________________________\r\nReply:\r\n\r\n[/message]', 1, 0, 0, 1373264093, 0, 0, 0, 0, 0, 0);
